  `commission_ratio` decimal(10, 2) UNSIGNED NULL DEFAULT 0.00 COMMENT '佣金比例   ',
  `Server_Distributes` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '佣金明细',
  `Server_BriefDescription` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '服务描述',
  `State` int(11) NULL DEFAULT NULL COMMENT '状态   1 启用   0挂关闭',
  `Service_Provider` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '服务商',
  `Count` int(10) NOT NULL COMMENT '话费金额(设置数量)',
  PRIMARY KEY (`Server_ID`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for biz
-- ----------------------------
DROP TABLE IF EXISTS `biz`;
CREATE TABLE `biz`  (
  `Biz_ID` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `Users_ID` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
