  `Biz_Address` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `Biz_PrimaryLng` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT 'Biz_PrimaryLng',
  `Biz_PrimaryLat` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT 'Biz_PrimaryLat',
  `Biz_Contact` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `Biz_Phone` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `Biz_Email` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `Biz_Homepage` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `Biz_Introduce` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `Biz_Status` tinyint(1) NULL DEFAULT 0,
  `Biz_CreateTime` int(10) UNSIGNED NULL DEFAULT 0,
  `Biz_SmsPhone` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `Shipping` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '快递公司及其对应模板',
  `Default_Shipping` smallint(6) NOT NULL DEFAULT 0 COMMENT '默认的快递公司',
  `Default_Business` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'express' COMMENT '默认的业务',
  `Biz_RecieveProvince` int(10) UNSIGNED NULL DEFAULT 0,
  `Biz_RecieveCity` int(10) UNSIGNED NULL DEFAULT 0,
  `Biz_RecieveArea` int(10) UNSIGNED NULL DEFAULT 0,
  `Biz_RecieveAddress` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `Biz_RecieveName` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `Biz_RecieveMobile` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `Is_Union` int(1) UNSIGNED NULL DEFAULT 0 COMMENT '是否联盟商家',
  `Skin_ID` int(10) UNSIGNED NULL DEFAULT 0,
  `Biz_Logo` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `Biz_Qrcode` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '二维码',
  `Biz_Kfcode` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `Category_ID` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '行业分类id',
  `Category_Arr` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '分类数组',
  `Biz_IndexShow` tinyint(1) NULL DEFAULT 0,
  `Biz_Index` int(10) UNSIGNED NULL DEFAULT 0,
  `Biz_MaxPrice` decimal(10, 2) NULL DEFAULT 0.00,
  `Biz_MinPrice` decimal(10, 2) NULL DEFAULT 0.00,
  `Region_ID` int(10) UNSIGNED NULL DEFAULT 0,
  `Biz_Notice` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '购物须知',
  `Biz_Profit` int(3) UNSIGNED NULL DEFAULT NULL COMMENT '线下消费利润率',
  `City_ID` int(11) UNSIGNED NULL DEFAULT NULL,
  `Group_ID` int(10) UNSIGNED NULL DEFAULT 0,
  `Finance_Type` tinyint(4) NULL DEFAULT 0 COMMENT '0 按照交易比例 1 单个产品设置',
  `Finance_Rate` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '交易结算利率网站提成百分比',
  `PC_Skin_ID` int(5) UNSIGNED NULL DEFAULT 1,
  `pc_banner` varchar(150) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `pc_slide` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `pc_bg_color` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `User_Mobile` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '绑定手机',
  `PaymenteRate` decimal(10, 2) NULL DEFAULT 100.00 COMMENT '结算比例',
  `Invitation_Code` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '邀请码',
  `Biz_PayConfig` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `Biz_Flag` tinyint(1) NULL DEFAULT 0,
  `is_agree` tinyint(3) NULL DEFAULT 0 COMMENT '是否签署协议0未签1已签',
  `is_auth` tinyint(3) NULL DEFAULT 0 COMMENT '是否认证0未认证1审核中2认证-1驳回',
  `is_pay` tinyint(3) NULL DEFAULT 0 COMMENT '0未付款1已付款',
  `bond_free` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '保证金',
  `is_biz` tinyint(3) NULL DEFAULT 0 COMMENT '0不是商家1成为商家',
  `expiredate` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '到期时间',
  `addtype` tinyint(1) NULL DEFAULT 0 COMMENT '0注册1后台添加',
  `bill_reduce_type` tinyint(1) NULL DEFAULT 0 COMMENT '线下扫码支付参与的优惠活动,1为满减,2为折扣,默认0为不设置优惠活动',
  `bill_man_json` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '满多少减多少,json格式为{\"man\":\"50\", \"jian\":\"5\"}',
  `bill_rebate` float(5, 2) NULL DEFAULT 0.00 COMMENT '线下扫码支付折扣,两位小数',
  `Finance_Type2` tinyint(4) NULL DEFAULT 0 COMMENT '线下结算类型的方法 0 按销售额比例 1 商家自身设置',
  `Biz_KfProductCode` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '产品里边的客服店铺代码',
  `QrcodeSet` int(10) NULL DEFAULT 300 COMMENT '收款二维码坐标',
  `qiword` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '联盟商家列表起字眼',
  `Biz_stmdShow` tinyint(1) NULL DEFAULT 1 COMMENT '是否显示在线买单',
  `barnerswitch` tinyint(3) NULL DEFAULT 0 COMMENT '店铺头像所用图选择',
  PRIMARY KEY (`Biz_ID`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 8 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

