-- ----------------------------
-- Table structure for pintuan_products
-- ----------------------------
DROP TABLE IF EXISTS `pintuan_products`;
CREATE TABLE `pintuan_products`  (
  `Products_ID` int(11) NOT NULL AUTO_INCREMENT,
