  `Products_PriceY` decimal(11, 2) NOT NULL,
  `Products_PriceX` decimal(11, 2) NOT NULL,
  `Products_PriceA` decimal(11, 2) NULL DEFAULT 0.00 COMMENT '属性显示价格',
  `Products_PriceAmax` decimal(11, 2) NULL DEFAULT 0.00 COMMENT '属性显示最大价格',
  `Products_JSON` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `skujosn` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'sku规格串',
  `skuvaljosn` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'sku规格值串',
  `Products_Profit` int(10) NULL DEFAULT 0 COMMENT '产品利润百分比',
  `tableeval` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '编辑查看的表格',
  `tableevals` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '编辑查看的规格',
  `skuimg` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'skuimg',
  `Products_BriefDescription` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `Products_SoldOut` tinyint(4) NULL DEFAULT NULL,
  `Products_IsNew` tinyint(4) NULL DEFAULT NULL,
  `Products_IsRecommend` tinyint(4) NULL DEFAULT NULL,
  `Products_IsShow` tinyint(1) NULL DEFAULT NULL COMMENT '是否在商城显示',
  `Products_IsPaysBalance` tinyint(1) NULL DEFAULT NULL COMMENT '是否支持余额支付',
  `Products_IsHot` tinyint(4) NULL DEFAULT NULL,
  `Products_IsShippingFree` tinyint(1) NULL DEFAULT 0,
  `Products_IsVip` tinyint(4) NULL DEFAULT NULL COMMENT 'VIP会员门槛商品',
  `Products_IsMember` tinyint(4) NULL DEFAULT NULL COMMENT '会员门槛商品',
  `Products_IsZongDai` tinyint(4) NULL DEFAULT 0 COMMENT '总代商品',
  `Products_Description` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `Products_CreateTime` int(10) NULL DEFAULT NULL,
  `Products_Count` int(10) NULL DEFAULT 0 COMMENT '商品库存',
  `Products_Weight` decimal(10, 2) NULL DEFAULT 0.00,
  `Products_Sales` int(10) NULL DEFAULT 0,
  `Products_Qrcode` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `Products_IsVirtual` tinyint(1) NULL DEFAULT 0,
  `Products_IsRecieve` tinyint(1) NULL DEFAULT 0,
  `Products_Shipping` smallint(6) NULL DEFAULT NULL,
  `Shipping_Free_Company` smallint(6) NULL DEFAULT 0 COMMENT '免运费时所指定的快递公司，0为所有快递公司均可',
  `Products_Business` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `commission_ratio` int(5) NULL DEFAULT 100 COMMENT '佣金所占利润的百分比',
  `Biz_ID` int(10) NULL DEFAULT 0,
  `deleted_at` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `Products_FinanceType` tinyint(1) NULL DEFAULT 0 COMMENT '0 按交易额比例 1 按供货价',
  `Products_PriceS` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '商品供货价',
  `Products_FinanceRate` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '网站提成百分比',
  `Products_Distributes` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '佣金配置json',
  `Products_BizCategory` int(10) NULL DEFAULT 0,
  `Products_BizIsNew` tinyint(1) NULL DEFAULT 0 COMMENT '商家店铺新品标志',
  `Products_BizIsHot` tinyint(1) NULL DEFAULT 0 COMMENT '商家店铺热卖标志',
  `Products_BizIsRec` tinyint(1) NULL DEFAULT 0 COMMENT '商家店铺推荐标志',
  `Products_BizIsMember` tinyint(4) NULL DEFAULT NULL COMMENT '商家店铺会员门槛商品',
  `Products_BizIsVip` tinyint(4) NULL DEFAULT NULL COMMENT '商家店铺VIP会员门槛商品',
  `Products_Status` tinyint(1) NULL DEFAULT 0 COMMENT '产品审核状态 0 未审核 1 审核',
  `Products_Index` int(10) NULL DEFAULT 9999,
  `nobi_ratio` int(10) NULL DEFAULT 0 COMMENT '爵位奖励',
  `platForm_Income_Reward` int(10) NULL DEFAULT 0 COMMENT '平台所获佣金比例',
  `area_Proxy_Reward` int(10) NULL DEFAULT 0 COMMENT '区域代理所获佣金比例',
  `sha_Reward` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '股东佣金比例',
  `click_count` int(11) NULL DEFAULT 0 COMMENT '点击次数',
  `Products_Integration` int(10) NULL DEFAULT 0 COMMENT '商品积分',
  `Products_PayCoin` int(10) NOT NULL DEFAULT 0 COMMENT '此产品需要多少积分,购买方式为积分加现金',
  `Product_backup` int(11) NULL DEFAULT 0 COMMENT '产品退货损坏说明',
  `salesman_ratio` int(8) NULL DEFAULT 0 COMMENT '业务提成',
  `salesman_level_ratio` varchar(250) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '业务各级提成',
  `Products_Union_ID` int(11) NULL DEFAULT 0 COMMENT '0-普通商家1-联盟商家产品',
  `Integrationswitch` tinyint(1) NULL DEFAULT 0 COMMENT '积分抵用开关 0 参于抵用 1 不参于抵用',
  `store_mention` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否支持到店自提，只有联盟商家支持',
  PRIMARY KEY (`Products_ID`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 50 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

