-- ----------------------------
DROP TABLE IF EXISTS `user_back_order`;
CREATE TABLE `user_back_order`  (
  `Back_ID` int(10) NOT NULL AUTO_INCREMENT,
  `Back_Sn` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '退款单号',
  `Users_ID` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `Biz_ID` int(10) NULL DEFAULT 0,
  `Order_ID` int(10) NOT NULL DEFAULT 0 COMMENT '来源订单号',
