  `Owner_ID` int(10) NULL DEFAULT 0 COMMENT '店主ID',
  `Back_Type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `Back_Json` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '退货详情',
  `Back_Shipping` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `Back_ShippingID` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `Back_Status` tinyint(2) NOT NULL DEFAULT 0 COMMENT '0 买家申请\r\n 1 卖家批准\r\n 2 买家发货\r\n 3 卖家收到货并确定退款金额\r\n 4 网站退款\r\n 5 卖家不同意退款\r\n 6 买家不同意退款金额',
  `Back_CreateTime` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `Biz_IsRead` tinyint(1) NULL DEFAULT 0 COMMENT '商加是否查看',
  `Buyer_IsRead` tinyint(1) NULL DEFAULT 0 COMMENT '买家是否查看',
  `Back_Qty` int(10) NULL DEFAULT 0 COMMENT '退款数量',
  `Back_Amount` decimal(10, 2) NULL DEFAULT 0.00,
  `Back_CartID` int(10) NULL DEFAULT 0,
  `ProductID` int(10) NULL DEFAULT 0,
  `Back_UpdateTime` int(10) NULL DEFAULT 0,
  `Back_IsCheck` tinyint(1) NULL DEFAULT 0,
  `Back_Account` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `Order_Status` tinyint(1) NULL DEFAULT 0 COMMENT '订单状态',
  `Order_FromID` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '订单号来源ID',
  `Sales_By` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0' COMMENT '卖出商品的商家，这里填写商家的Users_Account',
  `DistributeAccount_ID` int(10) NOT NULL DEFAULT 0 COMMENT '卖出商品的分销商ID',
  `Pro_skuvaljosn` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'sku规格值串',
  `batch_no` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '支付宝退款流水号',
  `Back_Integral` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '退还的积分抵扣的金额',
  `Back_Amount_Source` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '退款未加优惠数值源',
  `Back_Coin` int(10) NOT NULL DEFAULT 0 COMMENT '需要退还的积分,要写入user表的积分字段',
  PRIMARY KEY (`Back_ID`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 3 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

