  `Is_Backup_js` tinyint(1) NULL DEFAULT 0 COMMENT '是否是退货单',
  `addtype` tinyint(3) NOT NULL DEFAULT 0 COMMENT '订单生成类型：0前台生成1后台添加',
  `All_Qty` int(10) NULL DEFAULT 1 COMMENT '全部产品数量',
  `Is_User_Distribute` tinyint(1) NOT NULL DEFAULT 0 COMMENT '用户在购买产品时是否是分销商',
  `Back_salems` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '记录退款的创始人佣金',
  `back_qty` int(10) NULL DEFAULT 0 COMMENT '退的产品数量',
  `back_qty_str` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '退的产品明细串',
  `Back_Amount_Source` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '退款未加优惠数值源',
  `cash_str` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '产品优惠券明细串',
  `Web_Pricejs_new` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '商城所得没减过任何优惠',
  `store_mention` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否到店自提',
  `store_mention_time` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '到店自提时间',
  PRIMARY KEY (`Order_ID`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 168 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

